import React from 'react';
import '../App.css';

class Home extends React.Component {

  render() {
    return (
        <div className="App" style={{height: '100vh', overflow: 'auto'}}>
          <img src="../images/Bookshelf.png"></img>
        </div>
    );
  }
}
export default Home;
